//画像が読み込めない際は404の代替画像を表示させる
//https://on-ze.com/archives/1532
//https://9-bb.com/jquery-7/
$(document).ready(function () {
  //srcが空の時に代替画像を挿入
  $('img[src=""]').attr('src', 'data:image/png;base64,').addClass('alternateImage');
  //srcがリンク切れの時に代替画像を挿入
  $('img').on('error', function () {
    $(this).attr('src', 'data:image/png;base64,').addClass('alternateImage');
  });
})
